    end
    return assign_to
  end

  def goal_colors(goal)
    if goal.to_i == 100
    	color = '#a9d248'
    elsif goal > 50 && goal < 99
    	color = '#F2AF00'
    else
    	color = '#DC5034'
    end
    return color
  end

  def sys_color(sys)
  	systolic = sys.to_i
  	if systolic <= 120 && systolic > 0
      bps_color = 'well-green'
    elsif (120..140) === systolic
      bps_color = 'well-yellow'
    elsif (140..160) === systolic
      bps_color = 'well-orange'
    elsif systolic > 160
      bps_color = 'well-red'
  	elsif systolic == 0
	  bps_color = 'well-grey'
    else
      bps_color = 'well-red'
    end
    return bps_color
  end

  def dia_color(dia)
  	diastolic = dia.to_i
    if diastolic <= 80 && diastolic > 0
	  bpd_color = 'well-green'
	elsif (80..90) === diastolic
	  bpd_color = 'well-yellow'
	elsif (90..100) === diastolic
	  bpd_color = 'well-orange'
	elsif diastolic > 100
	  bpd_color = 'well-red'
  	elsif diastolic == 0
	  bpd_color = 'well-grey'
    else
	  bpd_color = 'well-red'
	end
	return bpd_color
  end

  def gluc_color(value)
	glucose = value.to_i
    if (80..100) === glucose
      gluc_color = 'well-green'
    elsif (101..125) === glucose
      gluc_color = 'well-orange'
    elsif glucose > 126
      gluc_color = 'well-red'
    else
      gluc_color = 'well-red'
    end
  end

  def hba1c_color(value)
  	hba1c = value.to_i
    if (4..6) === hba1c
	  hba1c_color = 'well-green'
	elsif (6..8) === hba1c
	  hba1c_color = 'well-orange'
	elsif (8..14) === hba1c
	  hba1c_color = 'well-red'
	else
	  hba1c_color = 'well-red'
	end
  end

  def bmi_colors(val)
  	value = val.to_i
  	if value < 18.5 && value > 0
  	  bmi_color = 'well-green'
	elsif value > 18.5 && value < 24.9
  	  bmi_color = 'well-orange'
	elsif value > 25
  	  bmi_color = 'well-red'
  	else
  	  bmi_color = 'well-grey'
	end
	return bmi_color
  end

end
